import React from 'react';
import {connect} from 'react-redux';
import CurrencyListItem from '../currency-list-item/currency-list-item';
import {convertibleCurrency} from '../../actions/index';

import './currency-list.css';

const CurrencyList = ({currency, currencyValue, onGetValue, value, value2, v3}) => {


	console.log('-->START LIST');
	console.log('Value1: ', value);
	console.log('Value2: ', value2);
	console.log('Value3: ', v3);
	console.log('END LIST<--');


	return (
		<div className="wrCurrencyList">
			<span className="titleCurrencyList">Currency Codes</span>
			<ul className="currencyList">
				<CurrencyListItem data={currency} onGetValue={onGetValue} />
			</ul>
		</div>
	);
};

const mapStateToProps = ({currency, value, value2, v3}) => {
	return {
		currency,
		value,
		value2,
		v3
	};
};

const mapStateDispatchToProps = (dispatch) => {
	return {
		onGetValue: (a,b) => {
			dispatch(convertibleCurrency(a,b));
		}
	};
};

export default connect(mapStateToProps, mapStateDispatchToProps)(CurrencyList);
